description:
Escribo como familia del CEIP Javier de Miguel, situado en la calle Puerto de Viñamala, 11. El objeto de este escrito es denunciar el abandono en el que se encuentra el mantenimiento del centro escolar. Desde el centro escolar nos consta a las familias que hay una lista bastante larga de reparaciones pendientes reclamadas por el centros escolar a las que no se les da solución. Ello atenta, gravemente, sobre la salud y seguridad del alumnado del centro escolar y de todo el personal adscrito. Enumero el listado de actuaciones que están pendientes y de los que adjunto varias evidencias gráficas:  

1.  Dos baños cerrados en el Pabellos de Primaria (afecta a la salubridad/uso de espacios);  
2.  Alcantarillado obstruido y roto en el Patio superior (afecta a la seguridad/uso de espacios);  
3.  Columpio y rocódromo con presas sueltas (afecta a la seguridad/uso de espacios);  
4.  Bajante agujereada encima de una luz en Porche (afecta a la seguridad/riesgo de cortocircuito);  
5.  Suelo de caucho agujereado en dos zonas infantiles (afecta a la seguridad/uso de espacios).  
6.  Gotera en el techo del Pabellón de Primaria (afecta a la seguridad y al uso de espacios).;  
7.  Papeleras descolgada (afecta a la salubridad/higiene); 8. Paredes desconchadas (afecta a la seguridad/fachadas).  

Solicito el arreglo de todos los puntos señalados aquí y una respuesta inmediata a nuestro centro educativo.
